package JAVA1_2018_03_05;

public class endsWith_String {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		String s1="java by javatpoint";
		System.out.println(s1.endsWith("t"));
		System.out.println(s1.endsWith("point"));
		System.out.println(s1.endsWith("int"));
		System.out.println(s1.endsWith("javatpoint"));
		System.out.println(s1.endsWith("by"));
		System.out.println(s1.endsWith("by javatpoint"));
		System.out.println(s1.endsWith("java"));
	}

}
